--
-- Name: actualizar_condicion_diente(uuid, integer, character varying, character varying, uuid, character varying, text, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.actualizar_condicion_diente(p_paciente_id uuid, p_diente_numero integer, p_superficie character varying, p_nueva_condicion character varying, p_intervencion_id uuid DEFAULT NULL::uuid, p_material character varying DEFAULT NULL::character varying, p_descripcion text DEFAULT NULL::text, p_registrado_por uuid DEFAULT NULL::uuid) RETURNS uuid
    LANGUAGE plpgsql
    AS $$
DECLARE
    nueva_condicion_id UUID;
BEGIN
    -- PASO 1: Desactivar condición anterior (marcar como histórica)
    UPDATE condiciones_diente
    SET activo = FALSE,
        updated_at = CURRENT_TIMESTAMP
    WHERE paciente_id = p_paciente_id
      AND diente_numero = p_diente_numero
      AND superficie = p_superficie
      AND activo = TRUE;

    -- PASO 2: Insertar nueva condición como activa
        paciente_id,
        diente_numero,
        superficie,
        tipo_condicion,
        material_utilizado,
        descripcion,
        intervencion_id,
        registrado_por,
        activo
    ) VALUES (
        p_paciente_id,
        p_diente_numero,
        p_superficie,
        p_nueva_condicion,
        p_material,
        p_descripcion,
        p_intervencion_id,
        p_registrado_por,
        TRUE
    ) RETURNING id INTO nueva_condicion_id;

    RETURN nueva_condicion_id;
END;
$$;


