-- Name: asignar_orden_llegada(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.asignar_orden_llegada() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    ultimo_orden_general INTEGER;
    ultimo_orden_odontologo INTEGER;
BEGIN
    -- Asignar orden general del día
    SELECT COALESCE(MAX(orden_llegada_general), 0) + 1
    INTO ultimo_orden_general
    FROM consultas
    WHERE DATE(fecha_llegada) = DATE(NEW.fecha_llegada);
    
    NEW.orden_llegada_general := ultimo_orden_general;
    
    -- Asignar orden en cola del odontólogo
    SELECT COALESCE(MAX(orden_cola_odontologo), 0) + 1
    INTO ultimo_orden_odontologo
    FROM consultas
    WHERE primer_odontologo_id = NEW.primer_odontologo_id
    AND DATE(fecha_llegada) = DATE(NEW.fecha_llegada)
    AND estado IN ('en_espera', 'en_atencion');
    
    NEW.orden_cola_odontologo := ultimo_orden_odontologo;
    
    RETURN NEW;
END;
$$;


ALTER FUNCTION public.asignar_orden_llegada() OWNER TO postgres;

--
-- Name: calcular_edad_paciente(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.calcular_edad_paciente() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF NEW.fecha_nacimiento IS NOT NULL THEN
        NEW.edad = EXTRACT(YEAR FROM AGE(NEW.fecha_nacimiento));
    END IF;
    RETURN NEW;
END;
$$;


ALTER FUNCTION public.calcular_edad_paciente() OWNER TO postgres;

--
-- Name: calcular_saldos_pago(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.calcular_saldos_pago() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    NEW.saldo_pendiente_bs = NEW.monto_total_bs - NEW.monto_pagado_bs;
    NEW.saldo_pendiente_usd = NEW.monto_total_usd - NEW.monto_pagado_usd;
    RETURN NEW;
END;
$$;


ALTER FUNCTION public.calcular_saldos_pago() OWNER TO postgres;

--
-- Name: calcular_totales_intervencion(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.calcular_totales_intervencion() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    total_bs_calc DECIMAL(10,2) := 0;
    total_usd_calc DECIMAL(10,2) := 0;
BEGIN
    -- Calcular totales de servicios para esta intervención
    SELECT 
        COALESCE(SUM(precio_total_bs), 0),
        COALESCE(SUM(precio_total_usd), 0)
    INTO total_bs_calc, total_usd_calc
    FROM intervenciones_servicios 
    WHERE intervencion_id = COALESCE(NEW.intervencion_id, OLD.intervencion_id);
    
    -- Actualizar totales en la intervención
    UPDATE intervenciones 
    SET 
        total_bs = total_bs_calc - COALESCE(descuento_bs, 0),
        total_usd = total_usd_calc - COALESCE(descuento_usd, 0)
    WHERE id = COALESCE(NEW.intervencion_id, OLD.intervencion_id);
    
    RETURN COALESCE(NEW, OLD);
END;
$$;


ALTER FUNCTION public.calcular_totales_intervencion() OWNER TO postgres;

--
-- Name: cambiar_odontologo_consulta(uuid, uuid, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.cambiar_odontologo_consulta(consulta_id_param uuid, nuevo_odontologo_id uuid, motivo text DEFAULT NULL::text) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE
    ultimo_orden INTEGER;
BEGIN
    -- Obtener último orden en cola del nuevo odontólogo
    SELECT COALESCE(MAX(orden_cola_odontologo), 0) + 1
    INTO ultimo_orden
    FROM consultas
    WHERE primer_odontologo_id = nuevo_odontologo_id
    AND DATE(fecha_llegada) = CURRENT_DATE
    AND estado IN ('en_espera', 'en_atencion');
    
    -- Actualizar la consulta
    UPDATE consultas
    SET 
        primer_odontologo_id = nuevo_odontologo_id,
        orden_cola_odontologo = ultimo_orden,
        observaciones = COALESCE(observaciones, '') || 
            CASE WHEN observaciones IS NOT NULL THEN E'\n' ELSE '' END ||
            'Cambiado de odontólogo: ' || COALESCE(motivo, 'Sin motivo especificado') || ' - ' || CURRENT_TIMESTAMP
    WHERE id = consulta_id_param;
    
    RETURN FOUND;
END;
$$;


ALTER FUNCTION public.cambiar_odontologo_consulta(consulta_id_param uuid, nuevo_odontologo_id uuid, motivo text) OWNER TO postgres;

--
-- Name: crear_odontograma_inicial(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.crear_odontograma_inicial() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    diente INTEGER;
    superficie TEXT;
    total_creadas INTEGER := 0;
BEGIN
    RAISE NOTICE 'Creando odontograma inicial para paciente %', NEW.numero_historia;
    
    -- Crear 32 dientes × 5 superficies = 160 condiciones "sano"
    FOR diente IN
        -- Cuadrante 1 (Superior Derecho): 18-11
        SELECT unnest(ARRAY[18, 17, 16, 15, 14, 13, 12, 11])
        UNION ALL
        -- Cuadrante 2 (Superior Izquierdo): 21-28
        SELECT unnest(ARRAY[21, 22, 23, 24, 25, 26, 27, 28])
        UNION ALL
        -- Cuadrante 3 (Inferior Izquierdo): 31-38
        SELECT unnest(ARRAY[31, 32, 33, 34, 35, 36, 37, 38])
        UNION ALL
        -- Cuadrante 4 (Inferior Derecho): 41-48
        SELECT unnest(ARRAY[41, 42, 43, 44, 45, 46, 47, 48])
    LOOP
        FOR superficie IN SELECT unnest(ARRAY['oclusal', 'mesial', 'distal', 'vestibular', 'lingual'])
        LOOP
                paciente_id,
                diente_numero,
                superficie,
                tipo_condicion,
                severidad,
                descripcion,
                color_hex,
                activo
            ) VALUES (
                NEW.id,
                diente,
                superficie,
                'sano',
                'leve',
                'Condición inicial',
                '#90EE90',
                TRUE
            );

            total_creadas := total_creadas + 1;
        END LOOP;
    END LOOP;

    RAISE NOTICE 'Odontograma inicial creado: % condiciones', total_creadas;

    RETURN NEW;
END;
$$;


ALTER FUNCTION public.crear_odontograma_inicial() OWNER TO postgres;

--
-- Name: generar_numero_consulta(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.generar_numero_consulta() RETURNS trigger
    LANGUAGE plpgsql
    AS $_$
DECLARE
    ultimo_numero INTEGER;
    nuevo_numero VARCHAR(20);
    fecha_actual DATE;
BEGIN
    IF NEW.numero_consulta IS NULL OR NEW.numero_consulta = '' THEN
        fecha_actual := CURRENT_DATE;
        
        SELECT COALESCE(MAX(CAST(SUBSTRING(numero_consulta FROM 10) AS INTEGER)), 0) + 1
        INTO ultimo_numero
        FROM consultas
        WHERE numero_consulta ~ ('^' || TO_CHAR(fecha_actual, 'YYYYMMDD') || '[0-9]+$');
        
        nuevo_numero := TO_CHAR(fecha_actual, 'YYYYMMDD') || LPAD(ultimo_numero::TEXT, 3, '0');
        NEW.numero_consulta := nuevo_numero;
    END IF;
    
    RETURN NEW;
END;
$_$;


ALTER FUNCTION public.generar_numero_consulta() OWNER TO postgres;

--
-- Name: generar_numero_historia(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.generar_numero_historia() RETURNS trigger
    LANGUAGE plpgsql
    AS $_$
DECLARE
    ultimo_numero INTEGER;
    nuevo_numero VARCHAR(20);
BEGIN
    IF NEW.numero_historia IS NULL OR NEW.numero_historia = '' THEN
        SELECT COALESCE(MAX(CAST(SUBSTRING(numero_historia FROM 3) AS INTEGER)), 0) + 1
        INTO ultimo_numero
        FROM pacientes
        WHERE numero_historia ~ '^HC[0-9]+$';
        
        nuevo_numero := 'HC' || LPAD(ultimo_numero::TEXT, 6, '0');
        NEW.numero_historia := nuevo_numero;
    END IF;
    
    RETURN NEW;
END;
$_$;


ALTER FUNCTION public.generar_numero_historia() OWNER TO postgres;

--
-- Name: generar_numero_recibo(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.generar_numero_recibo() RETURNS trigger
    LANGUAGE plpgsql
    AS $_$
DECLARE
    ultimo_numero INTEGER;
    nuevo_numero VARCHAR(20);
    fecha_actual DATE;
BEGIN
    IF NEW.numero_recibo IS NULL OR NEW.numero_recibo = '' THEN
        fecha_actual := CURRENT_DATE;
        
        SELECT COALESCE(MAX(CAST(SUBSTRING(numero_recibo FROM 8) AS INTEGER)), 0) + 1
        INTO ultimo_numero
        FROM pagos
        WHERE numero_recibo ~ ('^REC' || TO_CHAR(fecha_actual, 'YYYYMM') || '[0-9]+$');
        
        nuevo_numero := 'REC' || TO_CHAR(fecha_actual, 'YYYYMM') || LPAD(ultimo_numero::TEXT, 4, '0');
        NEW.numero_recibo := nuevo_numero;
    END IF;
    
    RETURN NEW;
END;
$_$;


ALTER FUNCTION public.generar_numero_recibo() OWNER TO postgres;

--
-- Name: manejar_version_odontograma(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.manejar_version_odontograma() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Si se está creando una nueva versión actual
    IF NEW.es_version_actual = TRUE THEN
        -- Marcar todas las otras versiones como no actuales
        UPDATE odontograma 
        SET es_version_actual = FALSE 
        WHERE paciente_id = NEW.paciente_id 
        AND id != NEW.id;
        
        -- Si no es la primera versión, calcular estadísticas
        IF NEW.version > 1 THEN
            NEW.estadisticas_condiciones = (
                SELECT jsonb_build_object(
                    'total_condiciones', COUNT(*),
                    'condiciones_por_tipo', jsonb_object_agg(tipo_condicion, cantidad)
                )
                FROM (
                    SELECT tipo_condicion, COUNT(*) as cantidad
                    FROM condiciones_diente 
                    WHERE odontograma_id = NEW.id
                    GROUP BY tipo_condicion
                ) stats
            );
        END IF;
    END IF;
    
    RETURN NEW;
END;
$$;


ALTER FUNCTION public.manejar_version_odontograma() OWNER TO postgres;

--
-- Name: obtener_proximo_paciente(uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.obtener_proximo_paciente(odontologo_id_param uuid) RETURNS TABLE(consulta_id uuid, paciente_nombre text, numero_historia character varying, orden_cola integer, tiempo_espera interval)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        c.id,
        TRIM(CONCAT(p.primer_nombre, ' ', COALESCE(p.segundo_nombre, ''), ' ', p.primer_apellido, ' ', COALESCE(p.segundo_apellido, ''))),
        p.numero_historia,
        c.orden_cola_odontologo,
        AGE(CURRENT_TIMESTAMP, c.fecha_llegada)
    FROM consultas c
    JOIN pacientes p ON c.paciente_id = p.id
    WHERE c.primer_odontologo_id = odontologo_id_param
    AND c.estado = 'en_espera'
    AND DATE(c.fecha_llegada) = CURRENT_DATE
    ORDER BY c.orden_cola_odontologo
    LIMIT 1;
END;
$$;


ALTER FUNCTION public.obtener_proximo_paciente(odontologo_id_param uuid) OWNER TO postgres;

--
-- Name: apply_rls(jsonb, integer); Type: FUNCTION; Schema: realtime; Owner: supabase_admin
--

CREATE FUNCTION realtime.apply_rls(wal jsonb, max_record_bytes integer DEFAULT (1024 * 1024)) RETURNS SETOF realtime.wal_rls
    LANGUAGE plpgsql
    AS $$
declare
-- Regclass of the table e.g. public.notes
entity_ regclass = (quote_ident(wal ->> 'schema') || '.' || quote_ident(wal ->> 'table'))::regclass;

-- I, U, D, T: insert, update ...
action realtime.action = (
    case wal ->> 'action'
        when 'I' then 'INSERT'
        when 'U' then 'UPDATE'
        when 'D' then 'DELETE'
        else 'ERROR'
    end
);

-- Is row level security enabled for the table
is_rls_enabled bool = relrowsecurity from pg_class where oid = entity_;

subscriptions realtime.subscription[] = array_agg(subs)
    from
        realtime.subscription subs
    where
        subs.entity = entity_;

-- Subscription vars
roles regrole[] = array_agg(distinct us.claims_role::text)
    from
        unnest(subscriptions) us;

working_role regrole;
claimed_role regrole;
claims jsonb;

subscription_id uuid;
subscription_has_access bool;
visible_to_subscription_ids uuid[] = '{}';

-- structured info for wal's columns
columns realtime.wal_column[];
-- previous identity values for update/delete
old_columns realtime.wal_column[];

error_record_exceeds_max_size boolean = octet_length(wal::text) > max_record_bytes;

-- Primary jsonb output for record
output jsonb;

begin
perform set_config('role', null, true);

columns =
    array_agg(
        (
            x->>'name',
            x->>'type',
            x->>'typeoid',
            realtime.cast(
                (x->'value') #>> '{}',
                coalesce(
                    (x->>'typeoid')::regtype, -- null when wal2json version <= 2.4
                    (x->>'type')::regtype
                )
            ),
            (pks ->> 'name') is not null,
            true
        )::realtime.wal_column
    )
    from
        jsonb_array_elements(wal -> 'columns') x
        left join jsonb_array_elements(wal -> 'pk') pks
            on (x ->> 'name') = (pks ->> 'name');

old_columns =
    array_agg(
        (
            x->>'name',
            x->>'type',
            x->>'typeoid',
            realtime.cast(
                (x->'value') #>> '{}',
                coalesce(
                    (x->>'typeoid')::regtype, -- null when wal2json version <= 2.4
                    (x->>'type')::regtype
                )
            ),
            (pks ->> 'name') is not null,
            true
        )::realtime.wal_column
    )
    from
        jsonb_array_elements(wal -> 'identity') x
        left join jsonb_array_elements(wal -> 'pk') pks
            on (x ->> 'name') = (pks ->> 'name');

for working_role in select * from unnest(roles) loop

    -- Update `is_selectable` for columns and old_columns
    columns =
        array_agg(
            (
                c.name,
                c.type_name,
                c.type_oid,
                c.value,
                c.is_pkey,
                pg_catalog.has_column_privilege(working_role, entity_, c.name, 'SELECT')
            )::realtime.wal_column
        )
        from
            unnest(columns) c;

    old_columns =
            array_agg(
                (
                    c.name,
                    c.type_name,
                    c.type_oid,
                    c.value,
                    c.is_pkey,
                    pg_catalog.has_column_privilege(working_role, entity_, c.name, 'SELECT')
                )::realtime.wal_column
            )
            from
                unnest(old_columns) c;

    if action <> 'DELETE' and count(1) = 0 from unnest(columns) c where c.is_pkey then
        return next (
            jsonb_build_object(
                'schema', wal ->> 'schema',
                'table', wal ->> 'table',
                'type', action
            ),
            is_rls_enabled,
            -- subscriptions is already filtered by entity
            (select array_agg(s.subscription_id) from unnest(subscriptions) as s where claims_role = working_role),
            array['Error 400: Bad Request, no primary key']
        )::realtime.wal_rls;

    -- The claims role does not have SELECT permission to the primary key of entity
    elsif action <> 'DELETE' and sum(c.is_selectable::int) <> count(1) from unnest(columns) c where c.is_pkey then
        return next (
            jsonb_build_object(
                'schema', wal ->> 'schema',
                'table', wal ->> 'table',
                'type', action
            ),
            is_rls_enabled,
            (select array_agg(s.subscription_id) from unnest(subscriptions) as s where claims_role = working_role),
            array['Error 401: Unauthorized']
        )::realtime.wal_rls;

    else
        output = jsonb_build_object(
            'schema', wal ->> 'schema',
            'table', wal ->> 'table',
            'type', action,
            'commit_timestamp', to_char(
                ((wal ->> 'timestamp')::timestamptz at time zone 'utc'),
                'YYYY-MM-DD"T"HH24:MI:SS.MS"Z"'
            ),
            'columns', (
                select
                    jsonb_agg(
                        jsonb_build_object(
                            'name', pa.attname,
                            'type', pt.typname
                        )
                        order by pa.attnum asc
                    )
                from
                    pg_attribute pa
                    join pg_type pt
                        on pa.atttypid = pt.oid
                where
                    attrelid = entity_
                    and attnum > 0
                    and pg_catalog.has_column_privilege(working_role, entity_, pa.attname, 'SELECT')
            )
        )
        -- Add "record" key for insert and update
        || case
            when action in ('INSERT', 'UPDATE') then
                jsonb_build_object(
                    'record',
                    (
                        select
                            jsonb_object_agg(
                                -- if unchanged toast, get column name and value from old record
                                coalesce((c).name, (oc).name),
                                case
                                    when (c).name is null then (oc).value
                                    else (c).value
                                end
                            )
                        from
                            unnest(columns) c
                            full outer join unnest(old_columns) oc
                                on (c).name = (oc).name
                        where
                            coalesce((c).is_selectable, (oc).is_selectable)
                            and ( not error_record_exceeds_max_size or (octet_length((c).value::text) <= 64))
                    )
                )
            else '{}'::jsonb
        end
        -- Add "old_record" key for update and delete
        || case
            when action = 'UPDATE' then
                jsonb_build_object(
                        'old_record',
                        (
                            select jsonb_object_agg((c).name, (c).value)
                            from unnest(old_columns) c
                            where
                                (c).is_selectable
                                and ( not error_record_exceeds_max_size or (octet_length((c).value::text) <= 64))
                        )
                    )
            when action = 'DELETE' then
                jsonb_build_object(
                    'old_record',
                    (
                        select jsonb_object_agg((c).name, (c).value)
                        from unnest(old_columns) c
                        where
                            (c).is_selectable
                            and ( not error_record_exceeds_max_size or (octet_length((c).value::text) <= 64))
                            and ( not is_rls_enabled or (c).is_pkey ) -- if RLS enabled, we can't secure deletes so filter to pkey
                    )
                )
            else '{}'::jsonb
        end;

        -- Create the prepared statement
        if is_rls_enabled and action <> 'DELETE' then
            if (select 1 from pg_prepared_statements where name = 'walrus_rls_stmt' limit 1) > 0 then
                deallocate walrus_rls_stmt;
            end if;
            execute realtime.build_prepared_statement_sql('walrus_rls_stmt', entity_, columns);
        end if;

        visible_to_subscription_ids = '{}';

        for subscription_id, claims in (
                select
                    subs.subscription_id,
                    subs.claims
                from
                    unnest(subscriptions) subs
                where
                    subs.entity = entity_
                    and subs.claims_role = working_role
                    and (
                        realtime.is_visible_through_filters(columns, subs.filters)
                        or (
                          action = 'DELETE'
                          and realtime.is_visible_through_filters(old_columns, subs.filters)
                        )
                    )
        ) loop

            if not is_rls_enabled or action = 'DELETE' then
                visible_to_subscription_ids = visible_to_subscription_ids || subscription_id;
            else
                -- Check if RLS allows the role to see the record
                perform
                    -- Trim leading and trailing quotes from working_role because set_config
                    -- doesn't recognize the role as valid if they are included
                    set_config('role', trim(both '"' from working_role::text), true),
                    set_config('request.jwt.claims', claims::text, true);

                execute 'execute walrus_rls_stmt' into subscription_has_access;

                if subscription_has_access then
                    visible_to_subscription_ids = visible_to_subscription_ids || subscription_id;
                end if;
            end if;
        end loop;

        perform set_config('role', null, true);

        return next (
            output,
            is_rls_enabled,
            visible_to_subscription_ids,
            case
                when error_record_exceeds_max_size then array['Error 413: Payload Too Large']
                else '{}'
            end
        )::realtime.wal_rls;

    end if;
end loop;

perform set_config('role', null, true);
end;
$$;


ALTER FUNCTION realtime.apply_rls(wal jsonb, max_record_bytes integer) OWNER TO supabase_admin;

--
-- Name: broadcast_changes(text, text, text, text, text, record, record, text); Type: FUNCTION; Schema: realtime; Owner: supabase_admin
--

CREATE FUNCTION realtime.broadcast_changes(topic_name text, event_name text, operation text, table_name text, table_schema text, new record, old record, level text DEFAULT 'ROW'::text) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    -- Declare a variable to hold the JSONB representation of the row
    row_data jsonb := '{}'::jsonb;
BEGIN
    IF level = 'STATEMENT' THEN
        RAISE EXCEPTION 'function can only be triggered for each row, not for each statement';
    END IF;
    -- Check the operation type and handle accordingly
    IF operation = 'INSERT' OR operation = 'UPDATE' OR operation = 'DELETE' THEN
        row_data := jsonb_build_object('old_record', OLD, 'record', NEW, 'operation', operation, 'table', table_name, 'schema', table_schema);
        PERFORM realtime.send (row_data, event_name, topic_name);
    ELSE
        RAISE EXCEPTION 'Unexpected operation type: %', operation;
    END IF;
EXCEPTION
    WHEN OTHERS THEN
        RAISE EXCEPTION 'Failed to process the row: %', SQLERRM;
END;

$$;


ALTER FUNCTION realtime.broadcast_changes(topic_name text, event_name text, operation text, table_name text, table_schema text, new record, old record, level text) OWNER TO supabase_admin;

--
-- Name: build_prepared_statement_sql(text, regclass, realtime.wal_column[]); Type: FUNCTION; Schema: realtime; Owner: supabase_admin
--

CREATE FUNCTION realtime.build_prepared_statement_sql(prepared_statement_name text, entity regclass, columns realtime.wal_column[]) RETURNS text
    LANGUAGE sql
    AS $$
      /*
      Builds a sql string that, if executed, creates a prepared statement to
      tests retrive a row from *entity* by its primary key columns.
      Example
          select realtime.build_prepared_statement_sql('public.notes', '{"id"}'::text[], '{"bigint"}'::text[])
      */
          select
      'prepare ' || prepared_statement_name || ' as
          select
              exists(
                  select
                      1
                  from
                      ' || entity || '
                  where
                      ' || string_agg(quote_ident(pkc.name) || '=' || quote_nullable(pkc.value #>> '{}') , ' and ') || '
              )'
          from
              unnest(columns) pkc
          where
              pkc.is_pkey
          group by
              entity
      $$;


ALTER FUNCTION realtime.build_prepared_statement_sql(prepared_statement_name text, entity regclass, columns realtime.wal_column[]) OWNER TO supabase_admin;

--
-- Name: cast(text, regtype); Type: FUNCTION; Schema: realtime; Owner: supabase_admin
--

CREATE FUNCTION realtime."cast"(val text, type_ regtype) RETURNS jsonb
    LANGUAGE plpgsql IMMUTABLE
    AS $$
    declare
      res jsonb;
    begin
      execute format('select to_jsonb(%L::'|| type_::text || ')', val)  into res;
      return res;
    end
    $$;


