ALTER VIEW public.vista_cola_odontologos OWNER TO postgres;

--
-- Name: vista_consultas_dia; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vista_consultas_dia AS
 SELECT c.id,
    c.numero_consulta,
    c.fecha_llegada,
    c.estado,
    c.tipo_consulta,
    c.motivo_consulta,
    c.orden_llegada_general,
    c.orden_cola_odontologo,
    c.costo_total_bs,
    c.costo_total_usd,
    p.numero_historia,
    TRIM(BOTH FROM concat(p.primer_nombre, ' ', COALESCE(p.segundo_nombre, ''::character varying), ' ', p.primer_apellido, ' ', COALESCE(p.segundo_apellido, ''::character varying))) AS paciente_nombre,
    p.celular_1 AS paciente_celular,
    p.numero_documento AS paciente_documento,
    pers_primer.id AS primer_odontologo_id,
    TRIM(BOTH FROM concat(pers_primer.primer_nombre, ' ', COALESCE(pers_primer.segundo_nombre, ''::character varying), ' ', pers_primer.primer_apellido, ' ', COALESCE(pers_primer.segundo_apellido, ''::character varying))) AS primer_odontologo_nombre,
    pers_primer.especialidad AS primer_odontologo_especialidad,
        CASE
            WHEN ((c.odontologo_preferido_id IS NOT NULL) AND (c.odontologo_preferido_id <> c.primer_odontologo_id)) THEN TRIM(BOTH FROM concat(pers_pref.primer_nombre, ' ', COALESCE(pers_pref.segundo_nombre, ''::character varying), ' ', pers_pref.primer_apellido, ' ', COALESCE(pers_pref.segundo_apellido, ''::character varying)))
            ELSE NULL::text
        END AS odontologo_preferido_nombre,
    ( SELECT count(*) AS count
           FROM public.intervenciones
          WHERE (intervenciones.consulta_id = c.id)) AS total_intervenciones,
    ( SELECT count(DISTINCT intervenciones.odontologo_id) AS count
           FROM public.intervenciones
          WHERE (intervenciones.consulta_id = c.id)) AS total_odontologos_atendieron
   FROM (((public.consultas c
     JOIN public.pacientes p ON ((c.paciente_id = p.id)))
     JOIN public.personal pers_primer ON ((c.primer_odontologo_id = pers_primer.id)))
     LEFT JOIN public.personal pers_pref ON ((c.odontologo_preferido_id = pers_pref.id)))
  WHERE (date(c.fecha_llegada) = CURRENT_DATE)
  ORDER BY c.orden_llegada_general;


ALTER VIEW public.vista_consultas_dia OWNER TO postgres;

--
-- Name: vista_odontograma_actual; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vista_odontograma_actual AS
 SELECT c.paciente_id,
    p.numero_historia,
    (((COALESCE(((p.primer_nombre)::text || ' '::text), ''::text) || COALESCE(((p.segundo_nombre)::text || ' '::text), ''::text)) || COALESCE(((p.primer_apellido)::text || ' '::text), ''::text)) || (COALESCE(p.segundo_apellido, ''::character varying))::text) AS paciente_nombre,
    c.diente_numero,
    c.superficie,
    c.tipo_condicion,
    c.severidad,
    c.material_utilizado,
    c.color_hex,
    c.fecha_registro,
    c.intervencion_id
   FROM (public.condiciones_diente c
     JOIN public.pacientes p ON ((c.paciente_id = p.id)))
  WHERE (c.activo = true)
  ORDER BY p.numero_historia, c.diente_numero, c.superficie;


ALTER VIEW public.vista_odontograma_actual OWNER TO postgres;

--
-- Name: vista_personal_completo; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vista_personal_completo AS
 SELECT p.id,
    p.numero_documento,
    p.tipo_documento,
    p.fecha_nacimiento,
    p.direccion,
    p.celular,
    p.tipo_personal,
    p.especialidad,
    p.numero_licencia,
    p.fecha_contratacion,
    p.salario,
    p.estado_laboral,
    p.observaciones,
    p.primer_nombre,
    p.segundo_nombre,
    p.primer_apellido,
    p.segundo_apellido,
    p.acepta_pacientes_nuevos,
    p.orden_preferencia,
    p.usuario_id,
    u.email,
    u.activo AS usuario_activo,
    u.ultimo_acceso,
    u.fecha_creacion,
    u.auth_user_id,
    u.avatar_url,
    u.metadata,
    u.configuraciones,
    r.id AS rol_id,
    r.nombre AS rol_nombre,
    r.descripcion AS rol_descripcion,
    r.permisos AS rol_permisos,
        CASE
            WHEN (p.id IS NOT NULL) THEN TRIM(BOTH FROM concat(COALESCE(p.primer_nombre, ''::character varying),
            CASE
                WHEN ((p.segundo_nombre IS NOT NULL) AND ((p.segundo_nombre)::text <> ''::text)) THEN (' '::text || (p.segundo_nombre)::text)
                ELSE ''::text
            END, ' ', COALESCE(p.primer_apellido, ''::character varying),
            CASE
                WHEN ((p.segundo_apellido IS NOT NULL) AND ((p.segundo_apellido)::text <> ''::text)) THEN (' '::text || (p.segundo_apellido)::text)
                ELSE ''::text
            END))
            ELSE split_part((u.email)::text, '@'::text, 1)
        END AS nombre_completo,
        CASE
            WHEN (((p.estado_laboral)::text = 'activo'::text) AND (u.activo = true)) THEN true
            ELSE false
        END AS completamente_activo,
        CASE
            WHEN (p.fecha_contratacion IS NOT NULL) THEN (CURRENT_DATE - p.fecha_contratacion)
            ELSE NULL::integer
        END AS dias_en_empresa,
    jsonb_build_object('id', u.id, 'email', u.email, 'activo', u.activo, 'auth_user_id', u.auth_user_id, 'nombre_completo',
        CASE
            WHEN (p.id IS NOT NULL) THEN TRIM(BOTH FROM concat(COALESCE(p.primer_nombre, ''::character varying),
            CASE
                WHEN ((p.segundo_nombre IS NOT NULL) AND ((p.segundo_nombre)::text <> ''::text)) THEN (' '::text || (p.segundo_nombre)::text)
                ELSE ''::text
            END, ' ', COALESCE(p.primer_apellido, ''::character varying),
            CASE
                WHEN ((p.segundo_apellido IS NOT NULL) AND ((p.segundo_apellido)::text <> ''::text)) THEN (' '::text || (p.segundo_apellido)::text)
                ELSE ''::text
            END))
            ELSE split_part((u.email)::text, '@'::text, 1)
        END) AS usuario_info
   FROM ((public.personal p
     JOIN public.usuarios u ON ((p.usuario_id = u.id)))
     JOIN public.roles r ON ((u.rol_id = r.id)))
  ORDER BY
        CASE
            WHEN (p.id IS NOT NULL) THEN (TRIM(BOTH FROM concat(COALESCE(p.primer_nombre, ''::character varying), ' ', COALESCE(p.primer_apellido, ''::character varying))))::character varying
            ELSE u.email
        END;


ALTER VIEW public.vista_personal_completo OWNER TO postgres;

